import Footer from "../components/footer/Footer"
// import * as func from '../../public/ScrollSmoother.js'

const Photo = () => {
  return (
    <>
      <Header />
      <section className="main">
        <div className="lert_column">.$*4</div>
        <div className="right_column"></div>
      </section>
      <Footer />
    </>
  )
}

export default Photo
